(460, 1, '2014-11-12', '16:10:04', 16, 'Entrou na Consulta de Produtos ', NULL, 'SELECT P.cod_produto, P.codigo,  P.nome as produto, M.nome as marca, C.nome as categoria, P.descricao_resumida, P.flag_ativo, P.flag_destaque, P.flag_mostrar_preco, P.flag_oferta  FROM \n				produto P \n				left join categoria C on (P.cod_categoria = C.cod_categoria ) \n				left join marca M on (P.cod_marca = M.cod_marca ) \n				 where 1=1  order by P.nome', NULL, '189.58.102.185', 'Consulta', '', 0),
(461, 1, '2014-11-12', '16:11:06', 16, 'Entrou na Consulta de Produtos ', NULL, 'SELECT P.cod_produto, P.codigo,  P.nome as produto, M.nome as marca, C.nome as categoria, P.descricao_resumida, P.flag_ativo, P.flag_destaque, P.flag_mostrar_preco, P.flag_oferta  FROM \n				produto P \n				left join categoria C on (P.cod_categoria = C.cod_categoria ) \n				left join marca M on (P.cod_marca = M.cod_marca ) \n				 where 1=1  order by P.nome', NULL, '189.58.102.185', 'Consulta', '', 0);
