(662, 1, '2014-12-27', '18:07:05', 16, 'O Produtos foi inserido', NULL, 'insert into produto (nome,valor,cod_categoria,descricao_resumida,descricao,meta_tag_titulo,meta_tag_descricao,slug,cod_produto)  values (''Cafe Expresso'',''0.00'',''25'',''Um café expresso (do italiano caffè espresso), frequentemente referido simplesmente como expresso (ou ainda internacionalmente espresso), é um método de preparar café através da passagem de água quente (não fervente) sob alta pressão pelo café moído.'',''&lt;p&gt;Um caf&amp;eacute; expresso (do italiano &lt;i&gt;caff&amp;egrave; espresso&lt;/i&gt;), frequentemente referido simplesmente como expresso (ou ainda internacionalmente espresso), &amp;eacute; um m&amp;eacute;todo de preparar caf&amp;eacute; atrav&amp;eacute;s da passagem de &amp;aacute;gua quente (n&amp;atilde;o fervente) sob alta press&amp;atilde;o pelo caf&amp;eacute; mo&amp;iacute;do.&lt;/p&gt;'',''Café Expresso | Delion Café'',''Café Expresso'',''cafe-expresso'','''') ', NULL, '189.58.74.113', 'Inserção', 'produto', 0),
