(666, 1, '2014-12-27', '18:20:27', 16, 'Entrou na Consulta de Produtos ', NULL, 'SELECT P.cod_produto, P.nome as produto, C.nome as categoria, P.descricao_resumida, P.valor, P.flag_destaque  FROM \n				produto P \n				left join categoria C on (P.cod_categoria = C.cod_categoria ) \n				 where 1=1  order by P.nome', NULL, '189.58.74.113', 'Consulta', '', 0),
(667, 1, '2014-12-27', '18:28:13', 16, 'O Produtos foi inserido', NULL, 'insert into produto (nome,valor,cod_categoria,descricao_resumida,descricao,meta_tag_titulo,meta_tag_descricao,slug,cod_produto)  values (''Café Mocca'',''4.00'',''25'',''O café mocca é uma variante do café com leite. É normalmente feito com um terço de expresso e dois terços de leite vaporizado,mas uma porção de chocolate é adicionada em forma de chocolate em pó adoçado, embora algumas variantes utilizem xarope de chocolate. Mocha pode conter chocolate escuro (meio amargo) ou ao leite.'',''&lt;p&gt;O caf&amp;eacute; mocca &amp;eacute; uma variante do caf&amp;eacute; com leite. &amp;Eacute; normalmente feito com um ter&amp;ccedil;o de expresso e dois ter&amp;ccedil;os de leite vaporizado,mas uma por&amp;ccedil;&amp;atilde;o de chocolate &amp;eacute; adicionada em forma de chocolate em p&amp;oacute; ado&amp;ccedil;ado, embora algumas variantes utilizem xarope de chocolate. Mocha pode conter chocolate escuro (meio amargo) ou ao leite.&lt;/p&gt;'',''Café Mocca | Delion Café'',''Café Mocca'',''cafe-mocca'','''') ', NULL, '189.58.74.113', 'Inserção', 'produto', 0),
(668, 1, '2014-12-27', '18:28:22', 16, 'Entrou na Consulta de Produtos ', NULL, 'SELECT P.cod_produto, P.nome as produto, C.nome as categoria, P.descricao_resumida, P.valor, P.flag_destaque  FROM \n				produto P \n				left join categoria C on (P.cod_categoria = C.cod_categoria ) \n				 where 1=1  order by P.nome', NULL, '189.58.74.113', 'Consulta', '', 0),
(669, 1, '2014-12-27', '18:30:42', 16, 'O Produtos foi inserido', NULL, 'insert into produto (nome,valor,cod_categoria,descricao_resumida,descricao,meta_tag_titulo,meta_tag_descricao,slug,cod_produto)  values (''Café com Leite'',''2.50'',''25'',''O café com leite é uma bebida de muitos contrastes, já que é apreciado em muitos lugares do mundo. Essa bebida surgiu na Europa. Quando o café entrou nesse continente e a fazer sucesso, regiões leiteiras da Europa tiveram a ideia de misturar o café com o leite , para dar a energia do café e o alimento do leite. Essa ideia não deu muito certo dentro da Europa, já que o leite não era produzido em to'',''&lt;p&gt;O caf&amp;eacute; com leite &amp;eacute; uma bebida de muitos contrastes, j&amp;aacute; que &amp;eacute; apreciado em muitos lugares do mundo. Essa bebida surgiu na Europa. Quando o caf&amp;eacute; entrou nesse continente e a fazer sucesso, regi&amp;otilde;es leiteiras da Europa tiveram a ideia de misturar o caf&amp;eacute; com o leite , para dar a energia do caf&amp;eacute; e o alimento do leite. Essa ideia n&amp;atilde;o deu muito certo dentro da Europa, j&amp;aacute; que o leite n&amp;atilde;o era produzido em todas as regi&amp;otilde;es para o consumo com o caf&amp;eacute;.&lt;/p&gt;'',''Café com Leite | Delion Café'',''Café com Leite'',''cafe-com-leite'','''') ', NULL, '189.58.74.113', 'Inserção', 'produto', 0);
