(1, '', 'Bolo de Cenoura', '&lt;p&gt;Bolo de Cenoura com calda de chocolate belga.&lt;/p&gt;', 'Bolo de Cenoura com calda de chocolate belga.', 1, 0, 0, 21, 'Bolo de Cenoura | Delion Café', 'Bolo de Cenoura', 'bolo-cenoura', 1, 0, 0),
(33, '', 'Bolo de Iogurte', '&lt;p&gt;Bolo de Iogurte com calda de lim&amp;atilde;o siciliano.&lt;/p&gt;', 'Bolo de Iogurte com calda de limão siciliano.', 1, 0, 0, 21, 'Bolo de Iogurte | Delion Café', 'Bolo de Iogurte', 'bolo-iogurte', 0, 0, 0),
(34, '', 'Bolo Amanteigado', '&lt;p&gt;Bolo amanteigado&lt;/p&gt;', 'Bolo amanteigado', 1, 0, 0, 21, 'Bolo Amanteigado | Delion Café', 'Bolo Amanteigado', 'bolo-amanteigadjjo', 0, 0, 0),
(35, '', 'Palha Italiana', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Palha italiana &amp;eacute; um confeito feito a partir de leite condensado e biscoito de maisena.&lt;/span&gt;&lt;/p&gt;', 'Palha italiana é um confeito feito a partir de leite condensado e biscoito de maisena.', 1, 1, 0, 27, 'Palha Italiana | Delion Café', 'Palha Italiana', 'palha-italiana', 0, 0, 0),
(36, '', 'Chai Latte', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Chai Latt&amp;eacute; &amp;eacute; uma deliciosa bebida de origem asi&amp;aacute;tica a base de leite e ch&amp;aacute; preto.&lt;/span&gt;&lt;/p&gt;', 'Chai Latté é uma deliciosa bebida de origem asiática a base de leite e chá preto.', 1, 0, 0, 23, 'Chai Latte | Delion Café', 'Chai Latte', 'chai-latte', 4, 0, 0),
(37, '', 'Cookies', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Cookie de Chocolate originou-se nos Estados  Unidos, e possui peda&amp;ccedil;os de chocolate como ingrediente distinto. A  receita tradicional combina uma massa composta de manteiga e tanto  a&amp;ccedil;&amp;uacute;car mascavo e branco com gotas de chocolate semi-doce.&lt;/span&gt;&lt;/p&gt;', 'Cookie de Chocolate originou-se nos Estados Unidos, e possui pedaços de chocolate como ingrediente distinto. A receita tradicional combina uma massa composta de manteiga e tanto açúcar mascavo e branco com gotas de chocolate semi-doce.', 1, 0, 0, 27, 'Cookies | Delion Café', 'Cookies ', 'cookies', 2.9, 0, 0),
(2, '', 'Colorado Appia', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;A palavra Appia vem do latim e significa  abelha. O nome perfeito para a primeira cerveja do Brasil a utilizar mel  em sua f&amp;oacute;rmula. Uma combina&amp;ccedil;&amp;atilde;o ex&amp;oacute;tica que, al&amp;eacute;m do mel das  laranjeiras, &amp;eacute; feita a partir da melhor cevada, trigos maltados e &lt;span class=\\&quot;text_exposed_show\\&quot;&gt;da exclusiva levedura de alta fermenta&amp;ccedil;&amp;atilde;o. Doce, encorpada e refrescante, &amp;eacute; perfeita para quem busca novos e diferentes sabores.&lt;br /&gt;\r\n&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', 'A palavra Appia vem do latim e significa abelha. O nome perfeito para a primeira cerveja do Brasil a utilizar mel em sua fórmula.', 1, 0, 0, 22, 'Cerveja Colorado Appia | Delion Café', 'Cerveja Colorado Appia', 'coloradjoappia', 19, 0, 0),
(3, '', 'Cerveja Schornstein IPA', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Forte e escura, essa IPA apresenta colora&amp;ccedil;&amp;atilde;o &amp;acirc;mbar, &amp;eacute; brilhante e exibe um denso creme. Aroma floral, c&amp;iacute;trico e frutado. &amp;Eacute; refrescante,  mostrando notas condimentadas e o caracter&amp;iacute;stico amargor do estilo.&lt;/span&gt;&lt;/p&gt;', 'Forte e escura, essa IPA apresenta coloração âmbar, é brilhante e exibe um denso creme.', 1, 0, 0, 22, 'Cerveja Schornstein IPA | Delion Café', 'Cerveja Schornstein IPA', 'cerveja-schornstein-ipa', 16.5, 0, 0),
(4, '', 'Cerveja Amazon Tapereba', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Amazon Tapereb&amp;aacute; Witbier , cerveja aromatizada  com fruto que leva o nome origin&amp;aacute;rio da Am&amp;eacute;rica Tropical, conhecido  tamb&amp;eacute;m como caj&amp;aacute;. A nova cerveja utiliza dois tipos de malte, o trigo e a  cevada. As witbiers tiveram origem na escola cerveje&lt;span class=\\&quot;text_exposed_show\\&quot;&gt;ira belga h&amp;aacute; mais de 400 anos. S&amp;atilde;o cervejas leves e bem refrescantes.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', 'Amazon Taperebá Witbier , cerveja aromatizada com fruto que leva o nome originário da América Tropical, conhecido também como cajá.', 1, 0, 0, 22, 'Cerveja Amazon Tapereba | Delion Café', 'Cerveja Amazon Tapereba', 'cerveja-amazon-tapereba', 11.5, 0, 0),
(5, '', 'Cerveja Klein Brown Ale', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;De origem inglesa, feita com 5 tipos de maltes  importados e l&amp;uacute;pulo trazido da Inglaterra, a Brown Ale faz parte da  fam&amp;iacute;lia de alta fermenta&amp;ccedil;&amp;atilde;o. Sua cor &amp;eacute; acobreada e os sabores lembram  nozes e caramelo.&lt;/span&gt;&lt;/p&gt;', 'De origem inglesa, feita com 5 tipos de maltes importados e lúpulo trazido da Inglaterra. ', 1, 0, 0, 22, 'Cerveja Klein Brown Ale | Delion Café', 'Cerveja Klein Brown Ale', 'cerveja-klein-brown-ale', 12.5, 0, 0),
(6, '', 'Cerveja Klein Weiss', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Cerveja Klein Weiss &amp;eacute; uma cerveja nacional,  fabricada no Paran&amp;aacute;. Esta cerveja brasileira apresenta uma colora&amp;ccedil;&amp;atilde;o  alaranjada levemente turva e segue os estilo alem&amp;atilde;o de cervejas de  trigo. Seu aroma e sabor apresentam toques de cravo e bana&lt;span class=\\&quot;text_exposed_show\\&quot;&gt;na. Harmoniza com queijos edam, gouda e gruy&amp;eacute;re e tamb&amp;eacute;m com carnes brancas, peixes, sushis e saladas.&lt;/span&gt;&lt;/span&gt;&lt;/p&gt;', 'Cerveja Klein Weiss é uma cerveja nacional, fabricada no Paraná. ', 1, 0, 0, 22, 'Cerveja Klein Weiss | Delion Café', 'Cerveja Klein Weiss', 'cerveja-klein-weiss', 0, 0, 0),
(7, '', 'Empanada de Carne', '&lt;p&gt;Empanada de carne assada.&lt;/p&gt;', 'Empanada de carne assada.', 1, 1, 0, 26, 'Empanada de Carne | Delion Café', 'Empanada de Carne', 'empanadja-carne', 3.25, 0, 0),
(8, '', 'Empanada de Frango', '&lt;p&gt;Empanada de Frango assada.&lt;/p&gt;', 'Empanada de Frango assada.', 1, 0, 0, 26, 'Empanada de Frango | Delion Café', 'Empanada de Frango.', 'empanadja-dje-frango', 3.25, 0, 0),
(9, '', 'Empanada de Legumes', '&lt;p&gt;Empanada de Legumes assada.&lt;/p&gt;', 'Empanada de Legumes assada.', 1, 0, 0, 26, 'Empanada de Legumes | Delion Café', 'Empanada de Legumes', 'empanadjjjja-djjjje-legumes', 3.25, 0, 0),
(10, '', 'Quiche de Queijo', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Quiche apesar de ser um prato tradicional da  culin&amp;aacute;ria francesa, sua origem &amp;eacute; alem&amp;atilde;, do reino medieval de Lothringen.  Mais tarde os franceses o batizaram de &amp;quot;Lorraine&amp;quot;. A palavra quiche vem  do alem&amp;atilde;o &amp;quot;kuchen&amp;quot;, que significa &amp;quot;torta&amp;quot;.&lt;br /&gt;\r\n&lt;/span&gt;&lt;/p&gt;\r\n&lt;p&gt;Esse quiche cont&amp;eacute;m 3 queijos.&lt;/p&gt;', 'Quiche apesar de ser um prato tradicional da culinária francesa, sua origem é alemã, do reino medieval de Lothringen.', 1, 1, 0, 26, 'Quiche de Queijo | Delion Café', 'Quiche de Queijo', 'quiche-queijo', 7.9, 0, 0),
(11, '', 'Quiche de Legumes', '&lt;p&gt;&lt;br /&gt;\r\n&lt;span class=\\&quot;userContent\\&quot;&gt;Quiche apesar de ser um prato tradicional da  culin&amp;aacute;ria francesa, sua origem &amp;eacute; alem&amp;atilde;, do reino medieval de Lothringen.  Mais tarde os franceses o batizaram de &amp;quot;Lorraine&amp;quot;. A palavra quiche vem  do alem&amp;atilde;o &amp;quot;kuchen&amp;quot;, que significa &amp;quot;torta&amp;quot;.&lt;/span&gt;&lt;/p&gt;', 'Quiche apesar de ser um prato tradicional da culinária francesa, sua origem é alemã, do reino medieval de Lothringen.', 1, 0, 0, 26, 'Quiche de Legumes | Delion Café', 'Quiche de Legumes', 'quiche-legumes', 6, 0, 0),
(12, '', 'Quiche de Frango', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Quiche apesar de ser um prato tradicional da  culin&amp;aacute;ria francesa, sua origem &amp;eacute; alem&amp;atilde;, do reino medieval de Lothringen.  Mais tarde os franceses o batizaram de &amp;quot;Lorraine&amp;quot;. A palavra quiche vem  do alem&amp;atilde;o &amp;quot;kuchen&amp;quot;, que significa &amp;quot;torta&amp;quot;.&lt;/span&gt;&lt;/p&gt;', 'Quiche apesar de ser um prato tradicional da culinária francesa, sua origem é alemã, do reino medieval de Lothringen. ', 1, 0, 0, 26, 'Quiche de Frango | Delion Café', 'Quiche de Frango', 'quiche-frango', 7.9, 0, 0),
(13, '', 'Quiche de Linguicinha Defumada', '&lt;p&gt;Quiche apesar de ser um prato tradicional da culin&amp;aacute;ria francesa, sua origem &amp;eacute; alem&amp;atilde;, do reino medieval de Lothringen. Mais tarde os franceses o batizaram de &amp;quot;Lorraine&amp;quot;. A palavra quiche vem do alem&amp;atilde;o &amp;quot;kuchen&amp;quot;, que significa &amp;quot;torta&amp;quot;.&lt;/p&gt;', 'Quiche apesar de ser um prato tradicional da culinária francesa, sua origem é alemã, do reino medieval de Lothringen.', 1, 1, 0, 26, 'Quiche de Linguicinha Defumada | Delion Café', 'Quiche de Linguicinha Defumada', 'quiche-linguicinha-djjjefumadjjja', 7.9, 0, 0),
(14, '', 'Quiche de Alho Poró', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Quiche apesar de ser um prato tradicional da  culin&amp;aacute;ria francesa, sua origem &amp;eacute; alem&amp;atilde;, do reino medieval de Lothringen.  Mais tarde os franceses o batizaram de &amp;quot;Lorraine&amp;quot;. A palavra quiche vem  do alem&amp;atilde;o &amp;quot;kuchen&amp;quot;, que significa &amp;quot;torta&amp;quot;.&lt;/span&gt;&lt;/p&gt;', 'Quiche apesar de ser um prato tradicional da culinária francesa, sua origem é alemã, do reino medieval de Lothringen.', 1, 0, 0, 26, 'Quiche de Alho Poró | Delion Café', 'Quiche de Alho Poró', 'quiche-alho-poro', 6, 0, 0),
(15, '', 'Cafe Expresso', '&lt;p&gt;Um caf&amp;eacute; expresso (do italiano &lt;i&gt;caff&amp;egrave; espresso&lt;/i&gt;), frequentemente referido simplesmente como expresso (ou ainda internacionalmente espresso), &amp;eacute; um m&amp;eacute;todo de preparar caf&amp;eacute; atrav&amp;eacute;s da passagem de &amp;aacute;gua quente (n&amp;atilde;o fervente) sob alta press&amp;atilde;o pelo caf&amp;eacute; mo&amp;iacute;do.&lt;/p&gt;', 'Um café expresso (do italiano caffè espresso), frequentemente referido simplesmente como expresso (ou ainda internacionalmente espresso), é um método de preparar café através da passagem de água quente (não fervente) sob alta pressão pelo café moído.', 1, 0, 0, 25, 'Café Expresso | Delion Café', 'Café Expresso', 'cafe-expresso', 1, 0, 0),
(16, '', 'Café Havaiano', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Caf&amp;eacute; Havaiano,  feito com caf&amp;eacute; do cerrado mineiro, fornecido pela Lucca Caf&amp;eacute; Especiais, deixando o sabor ainda mais apurado.&lt;/span&gt;&lt;/p&gt;', 'Café Havaiano, feito com café do cerrado mineiro, fornecido pela Lucca Café Especiais, deixando o sabor ainda mais apurado.', 1, 0, 0, 25, 'Café Havaiano | Delion Café', 'Café Havaiano', 'cafe-havaiano', 4, 0, 0),
(17, '', 'Café Mocca', '&lt;p&gt;O caf&amp;eacute; mocca &amp;eacute; uma variante do caf&amp;eacute; com leite. &amp;Eacute; normalmente feito com um ter&amp;ccedil;o de expresso e dois ter&amp;ccedil;os de leite vaporizado,mas uma por&amp;ccedil;&amp;atilde;o de chocolate &amp;eacute; adicionada em forma de chocolate em p&amp;oacute; ado&amp;ccedil;ado, embora algumas variantes utilizem xarope de chocolate. Mocha pode conter chocolate escuro (meio amargo) ou ao leite.&lt;/p&gt;', 'O café mocca é uma variante do café com leite. É normalmente feito com um terço de expresso e dois terços de leite vaporizado,mas uma porção de chocolate é adicionada em forma de chocolate em pó adoçado, embora algumas variantes utilizem xarope de chocolate. Mocha pode conter chocolate escuro (meio amargo) ou ao leite.', 1, 0, 0, 25, 'Café Mocca | Delion Café', 'Café Mocca', 'cafe-mocca', 4, 0, 0),
(18, '', 'Café com Leite', '&lt;p&gt;O caf&amp;eacute; com leite &amp;eacute; uma bebida de muitos contrastes, j&amp;aacute; que &amp;eacute; apreciado em muitos lugares do mundo. Essa bebida surgiu na Europa. Quando o caf&amp;eacute; entrou nesse continente e a fazer sucesso, regi&amp;otilde;es leiteiras da Europa tiveram a ideia de misturar o caf&amp;eacute; com o leite , para dar a energia do caf&amp;eacute; e o alimento do leite. Essa ideia n&amp;atilde;o deu muito certo dentro da Europa, j&amp;aacute; que o leite n&amp;atilde;o era produzido em todas as regi&amp;otilde;es para o consumo com o caf&amp;eacute;.&lt;/p&gt;', 'O café com leite é uma bebida de muitos contrastes, já que é apreciado em muitos lugares do mundo. Essa bebida surgiu na Europa. Quando o café entrou nesse continente e a fazer sucesso, regiões leiteiras da Europa tiveram a ideia de misturar o café com o leite , para dar a energia do café e o alimento do leite. Essa ideia não deu muito certo dentro da Europa, já que o leite não era produzido em to', 1, 0, 0, 25, 'Café com Leite | Delion Café', 'Café com Leite', 'cafe-com-leite', 2.5, 0, 0),
(19, '', 'Capuccino', '&lt;p&gt;Cappuccino cl&amp;aacute;ssico, muito famoso no Brasil e consiste em um ter&amp;ccedil;o de caf&amp;eacute; expresso, um ter&amp;ccedil;o de leite vaporizado e um ter&amp;ccedil;o de espuma de leite vaporizado.&lt;/p&gt;', 'Cappuccino clássico, muito famoso no Brasil e consiste em um terço de café expresso, um terço de leite vaporizado e um terço de espuma de leite vaporizado.', 1, 0, 0, 25, 'Cappuccino | Delion Café', 'Cappuccino ', 'cappuccino', 4, 0, 0),
(20, '', 'Quindim Tradicional', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Quindim &amp;eacute; um doce que tem como ingredientes  gema de ovo, a&amp;ccedil;&amp;uacute;car e coco ralado . A receita que utiliza coco ralado &amp;eacute;  origin&amp;aacute;ria do nordeste brasileiro, diferente da receita portuguesa,  conhecida como brisa-do-Lis, que no lugar do coco ralado utiliza  am&amp;ecirc;ndoa. &lt;/span&gt;&lt;/p&gt;', 'Quindim é um doce que tem como ingredientes gema de ovo, açúcar e coco ralado . A receita que utiliza coco ralado é originária do nordeste brasileiro, diferente da receita portuguesa, conhecida como brisa-do-Lis, que no lugar do coco ralado utiliza amêndoa. ', 1, 1, 0, 27, 'Quindim Tradicional | Delion Café', 'Quindim Tradicional', 'quindjim-tradjicional', 3.5, 0, 0),
(21, '', 'Banoffe', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;Banoffee &amp;eacute; uma torta de origem inglesa feita com bananas, chantilly, e toffee de doce de leite.&lt;/span&gt;&lt;/p&gt;', 'Banoffee é uma torta de origem inglesa feita com bananas, chantilly, e toffee de doce de leite.', 1, 1, 0, 27, 'Banoffee | Delion Café', 'Banoffee', 'banoffee', 4.5, 0, 0),
(22, '', 'Torta holandesa tradicional', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;A torta holandesa &amp;eacute; uma torta feita por uma  massa leve, espessa e fria, com cobertura suave de creme de leite  fresco, chocolate meio amargo e bolachas banhadas no chocolate ao leite,  decorando a torta em volta.&lt;/span&gt;&lt;/p&gt;', 'A torta holandesa é uma torta feita por uma massa leve, espessa e fria, com cobertura suave de creme de leite fresco, chocolate meio amargo e bolachas banhadas no chocolate ao leite, decorando a torta em volta.', 1, 1, 0, 24, 'Torta Holandesa Tradicional | Delion Café', 'Torta Holandesa Tradicional ', 'torta-holandjesa-tradjicional', 0, 0, 0),
(23, '', 'Torta holandesa tiramissu', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;A torta holandesa &amp;eacute; uma torta feita por uma  massa leve, espessa e fria, com cobertura suave de creme de leite  fresco, chocolate meio amargo e bolachas banhadas no chocolate ao leite,  decorando a torta em volta.&lt;/span&gt;&lt;/p&gt;', 'A torta holandesa é uma torta feita por uma massa leve, espessa e fria, com cobertura suave de creme de leite fresco, chocolate meio amargo e bolachas banhadas no chocolate ao leite, decorando a torta em volta.', 1, 0, 0, 24, 'Torta Holandesa Tiramissu | Delion Café', 'Torta Holandesa Tiramissu', 'torta-holandjesa-tiramissu', 0, 0, 0),
(24, '', 'Torta holandesa de banana', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;A torta holandesa &amp;eacute; uma torta feita por uma  massa leve, espessa e fria, com cobertura suave de creme de leite  fresco, chocolate meio amargo e bolachas banhadas no chocolate ao leite,  decorando a torta em volta.&lt;/span&gt;&lt;/p&gt;', 'A torta holandesa é uma torta feita por uma massa leve, espessa e fria, com cobertura suave de creme de leite fresco, chocolate meio amargo e bolachas banhadas no chocolate ao leite, decorando a torta em volta.', 1, 0, 0, 24, 'Torta Holandesa de Banana | Delion Café', 'Torta Holandesa de Banana', 'torta-holandjesa-banana', 0, 0, 0),
(25, '', 'Torta holandesa de caramelo', '&lt;p&gt;&lt;span class=\\&quot;userContent\\&quot;&gt;A torta holandesa &amp;eacute; uma torta feita por uma  massa leve, espessa e fria, com cobertura suave de creme de leite  fresco, chocolate meio amargo e bolachas banhadas no chocolate ao leite,  decorando a torta em volta.&lt;/span&gt;&lt;/p&gt;', 'A torta holandesa é uma torta feita por uma massa leve, espessa e fria, com cobertura suave de creme de leite fresco, chocolate meio amargo e bolachas banhadas no chocolate ao leite, decorando a torta em volta.', 1, 0, 0, 24, 'Torta Holandesa de Caramelo | Delion Café', 'Torta Holandesa de Caramelo', 'torta-holandjesa-caramelo', 0, 0, 0),
